  false,\n\t\"url\": null,\n\t\"notes\": \"This dataset contains thermal springs data
  compiled by the University of Hawaii, and published as a Web feature service for
  the National Geothermal Data System. Fields in the Thermal Spring Feature Content
  Model will become XML elements in interchange documents for WMS simple features
  provided by a node in the USGIN network. Each feature includes a spring name, measured
  temperature, date collected and Source. The dataset is spatially referenced to EPSG:
  4326 (for interoperability). The data contained in the submitted dataset is available
  as an Excel Spreadsheet, ESRI service, WMS and WFS service. Link to Thermal Spring
  Feature Content Model: http://www.stategeothermaldata.org/data_delivery/content_models/hot_spring_feature_content.\",\n\t\"license_title\":
